import React, { useState, useEffect } from "react";

const removeMarkdown = require("remove-markdown")

const Body = () => {
  const [fishList, setFish] = useState("");

  useEffect(() => {
    fetch("https://www.fishwatch.gov/api/species")
      .then((res) => res.json())
      .then(
        (everyFish) => {
          console.log(everyFish)
          setFish(removeMarkdown(everyFish[Math.floor(Math.random() * 115)].Availability));
        },
        (error) => {
          console.log("error");
        }
      );
  }, []);

  return (
    <div>
      <h1> {fishList}</h1>
      <button onClick="">Get Random Fish!</button>
    </div>
  );
};

export default Body;
